import React from 'react';

const Dashboards = () => {
  return (
    <div className="overview-card">
      <h3>Tableros creados</h3>
      <select>
        <option>INDICADORES EN MATERIA DE AGUA POTABLE Y SANEAMIENTO...</option>
      </select>
      <p>Total: 3</p>
      <p>Descripción: No registra</p>
      <p>Fecha creación: 26 sep 2023</p>
      <p>Autor: admin_creangel</p>
    </div>
  );
};

export default Dashboards;
